import React from 'react'
import Star from '../resources/starGray'
import './ReviewsPeoples.css';


const ReviewsPeoples = (props) => {

    const {oneName,oneDate,oneReviews} = props
    // const OneReview = [
    //     {
    //         oneName:'123',
    //         oneDate:'let now = new Date()',
    //         oneReviews: '345',
    //     }
    // ]
    // // const { oneName} = OneReviews
    // // console.log(title)

    return (
        <div className='all_reviews'>
        <div className='header_all_reviews'>
            <div className='name_all_reviews'>{oneName}</div> 
            <div className='data_all_reviews'>{oneDate}</div> 
            <div className='zvezdi_all_reviews'>
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg> 
                    <svg className='star_IMG'>{Star}</svg>


            </div>
        </div>
        <div className='otziv_all_reviews'>{oneReviews}</div>
    </div>
    )
}


export default ReviewsPeoples;
